function ListTodos({ todos, changeCompleteTodo }) {
    return (
        <>
            <ul>
                {todos && todos.map((todo) => (
                    <li key={todo.id}>
                        <input type="checkbox" checked={todo.isComplete} onChange={() => changeCompleteTodo(todo.id)}/>
                        <span className={todo.isComplete ? "todo-completed" : ""}>{todo.textTodo}</span>
                        <span className="deleteTodo" >&times;</span>
                    </li>
                ))}
            </ul>
        </>
    )
}

export { ListTodos }
